import React from "react";
import  Data  from "./data.json"
import "./App.css"


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: Data,
    };
  }

  render() {
    return (
      <ul>
        {this.state.data.map(emoji => <li className="card" >{emoji.symbol}</li>)}
      </ul>
    );
  }
}

export default App;
